import styled from 'styled-components'


export const Container = styled.div`
    display: flex;
    align-items: center;
    padding: 1rem 2.5rem;
    border-bottom: 2px solid #ffaa00;
`

export const HamburgerContainer = styled.div`
    display: flex;
`

export const Title = styled.h2`
    font-size: 1.5rem;
    color: #ffaa00;
    margin: 0rem 2rem;
    white-space: nowrap;
`
